import { css } from "@emotion/core";
import Skeleton from "@material-ui/lab/Skeleton";
import React from "react";

const container = css`
    width: 100%auto;
`;

const AppSkeleton = () => (
    <div css={container}>
        <Skeleton variant="rect" width={210} height={118} />
    </div>
);

export default AppSkeleton;
